// Cart.js
import React from 'react';

const Cart = ({ cartItems }) => {
  return (
    <div>
      <h2>Your Cart</h2>
      <ul>
        {cartItems.map(item => (
          <li key={item.product_name}>
            {item.product_name} - ${item.unit_price}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Cart;
